script: |
  super -f tsv -I q6160.sql | sort > q6160.out

vector: true

inputs:
  - name: q6160.sql
    data: |
      SELECT ALL MIN ( DISTINCT 21 ) AS col2 FROM tab1 AS cor0 WHERE NOT - CAST ( col1 AS INTEGER ) BETWEEN NULL AND col1 + + CAST ( - 22 AS INTEGER ) / - col1 OR col2 IS NOT NULL;
  - name: tab1

outputs:
  - name: q6160.out
    data: |
      21
